Emperor (DvdRip)

He came...He saw...He came. A European film director (Rocco) is in the middle of a mid-life crisis. He feels that maybe the world of adult films may fulfill his artistic visions. With his wife (Dasha) and ex-wife (Janine), they all rendezvous in Cannes for his latest project, in what may prove to be his last mainstream film. Rocco, at the festival, meets a mysterious woman who leads him down the path of adult cinema and to a new world of expression. No censors, nothing forbidden, no limits. Could this be the artistic kingdom that Rocco has been looking for, or a sexual wonderland?

